-- ----------------------------
-- Procedure structure for user_add_node
-- ----------------------------
DROP PROCEDURE IF EXISTS `user_add_node`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `user_add_node`(IN p_parent INT, IN p_name VARCHAR(50) , IN p_fullname VARCHAR(100)
, IN p_image VARCHAR(500))
proc: BEGIN

        -- Declare variables
        DECLARE e_name_already_exists CONDITION FOR SQLSTATE '45000';
        DECLARE e_name_is_empty CONDITION FOR SQLSTATE '45000';
        DECLARE e_no_parent CONDITION FOR SQLSTATE '45000';
        DECLARE e_parent_not_found  CONDITION FOR SQLSTATE '45000';
        DECLARE v_parent_found INT DEFAULT 0;
        DECLARE v_found_name INT DEFAULT NULL;
        DECLARE v_label VARCHAR(100) DEFAULT NULL;
        DECLARE v_image VARCHAR(500) DEFAULT NULL;
        DECLARE v_parent_lft INT DEFAULT NULL;
        DECLARE v_parent_rht INT DEFAULT NULL;
        DECLARE v_parent_lvl MEDIUMINT DEFAULT NULL;
        DECLARE v_new_id INT DEFAULT NULL;

        -- Use default values if NULL is given as parameter
        SET v_label := COALESCE( p_fullname, p_name);
        SET v_image := COALESCE( p_image, v_image);

        -- Validate the parent (node_id)
        IF ( p_parent IS NULL) THEN
            SIGNAL e_no_parent
                SET MESSAGE_TEXT = 'The id of the parent node cannot be empty.';
            LEAVE proc;
        END IF;
        SELECT id, left_id, right_id, ancestor_id INTO v_parent_found, v_parent_lft, v_parent_rht, v_parent_lvl
          FROM user
         WHERE id = p_parent;

        IF ( v_parent_found IS NULL) THEN
            SIGNAL e_parent_not_found
                SET MESSAGE_TEXT = 'The tree_id of the parent does not exists.';
            LEAVE proc;
        END IF;

        -- Validate the name of the node
        IF ( p_name IS NULL) OR ( p_name = '') THEN
            SIGNAL e_name_already_exists
                SET MESSAGE_TEXT = 'The name of the node cannot be empty.';
            LEAVE proc;
        END IF;

        -- check if the name already exists in this branch
        SELECT 1
          INTO v_found_name
          FROM user
         WHERE left_id >= v_parent_lft
           AND left_id <  v_parent_rht
           AND ancestor_id =  v_parent_lvl + 1
           AND username LIKE BINARY p_name ;

        IF v_found_name <> 0 THEN
            SIGNAL e_name_already_exists
               SET MESSAGE_TEXT = 'A node whith the exact same name already exists in this branch';
               LEAVE proc;
        END IF;

        -- insert the new node
        START TRANSACTION;
            -- make some room in the tree
            UPDATE user SET left_id = CASE WHEN left_id >  v_parent_rht THEN left_id + 2 ELSE left_id END
                            ,right_id = CASE WHEN right_id >= v_parent_rht THEN right_id + 2 ELSE right_id END
             WHERE right_id >= v_parent_rht;
            -- insert
                 VALUES ( p_name , v_label, v_image , v_parent_rht , v_parent_rht + 1,v_parent_lvl + 1, p_parent);

            SELECT LAST_INSERT_ID() INTO v_new_id;
        COMMIT;

        -- return the inserted id
        SELECT v_new_id AS tree_id;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for user_get_branch
-- ----------------------------
DROP PROCEDURE IF EXISTS `user_get_branch`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `user_get_branch`(IN p_id INT
    ,IN p_depth TINYINT
    ,IN p_indent VARCHAR(20))
proc: BEGIN

        -- Declare variables
        DECLARE e_no_id CONDITION FOR SQLSTATE '45000';
        DECLARE e_id_not_found  CONDITION FOR SQLSTATE '45000';
        DECLARE v_node_found INT DEFAULT NULL;
        DECLARE v_node_lft INT DEFAULT NULL;
        DECLARE v_node_rht INT DEFAULT NULL;
        DECLARE v_node_lvl MEDIUMINT DEFAULT NULL;
        DECLARE v_indent VARCHAR(20) DEFAULT NULL;
        DECLARE v_depth TINYINT DEFAULT 127;

        -- Validate the tree_id
        IF ( p_id IS NULL) THEN
            SIGNAL e_no_id
                SET MESSAGE_TEXT = 'The id cannot be empty.';
            LEAVE proc;
        END IF;
        SELECT id, left_id, right_id, ancestor_id INTO v_node_found, v_node_lft, v_node_rht, v_node_lvl
          FROM user
         WHERE id = p_id;

        IF ( v_node_found IS NULL) THEN
            SIGNAL e_id_not_found
                SET MESSAGE_TEXT = 'The tree_id does not exists.';
            LEAVE proc;
        END IF;

        -- Use default values if NULL is given as parameter
        SET v_indent := COALESCE( p_indent, '');
        SET v_depth := COALESCE( p_depth, v_depth);

        -- select the branch
        SELECT id
             , parent_id
             , fullname
             , gender
             , description
             , ancestor_id
          FROM user
         WHERE left_id >= v_node_lft
           AND left_id < v_node_rht
           AND ancestor_id < p_depth+v_node_lvl+1
         ORDER BY left_id;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for user_get_parents
-- ----------------------------
DROP PROCEDURE IF EXISTS `user_get_parents`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `user_get_parents`(IN p_id INT
    ,IN p_indent VARCHAR(20))
proc: BEGIN

        -- Declare variables
        DECLARE e_no_id CONDITION FOR SQLSTATE '45000';
        DECLARE e_id_not_found  CONDITION FOR SQLSTATE '45000';
        DECLARE v_node_found INT DEFAULT NULL;
        DECLARE v_node_lft INT DEFAULT NULL;
        DECLARE v_indent VARCHAR(20) DEFAULT NULL;

        -- Validate the tree_id
        IF (p_id IS NULL) THEN
            SIGNAL e_no_id
                SET MESSAGE_TEXT = 'The id cannot be empty.';
            LEAVE proc;
        END IF;
        SELECT id, left_id INTO v_node_found, v_node_lft
          FROM user
         WHERE id = p_id;

        IF ( v_node_found IS NULL) THEN
            SIGNAL e_id_not_found
                SET MESSAGE_TEXT = 'The tree_id does not exists.';
            LEAVE proc;
        END IF;

        -- Use default values if NULL is given as parameter
        SET v_indent := COALESCE( p_indent, '');

        -- select the parents
        SELECT a.id
             , a.parent_id
             , a.gender
             , a.username
             , CONCAT(REPEAT( v_indent, a.ancestor_id ), a.fullname) AS fullname
             , a.description
             , a.ancestor_id
          FROM user a, user b
         WHERE b.id = p_id
           AND b.left_id BETWEEN a.left_id AND a.right_id;
END
;;
DELIMITER ;
